CREATE USER [az-synapse-aid-lab-ws] FROM EXTERNAL PROVIDER;

--Granting permission to the identity
GRANT CONTROL ON DATABASE::sqlpool01 TO [az-synapse-aid-lab-ws];

CREATE DATABASE SQLOnDemand01


CREATE CREDENTIAL [https://<azsynapseaiddl>.dfs.core.windows.net]
WITH IDENTITY='User Identity';

DROP TABLE [wwi].[SampleData]; 


CREATE TABLE [wwi].[SampleData] 
(
    [customerkey] REAL, 
    [stockitemkey] REAL
);


INSERT INTO [wwi].[SampleData] ([customerkey], [stockitemkey])
VALUES ( 11, 1 );


SELECT * FROM [wwi].[SampleData];

-- Retrieve the latest hex encoded ONNX model from the table
DECLARE @model varbinary(max) = (SELECT Model FROM [wwi_ml].[MLModel] WHERE Id = (SELECT Top(1) max(ID) FROM [wwi_ml].[MLModel]));

-- Run a prediction query
SELECT d.*, p.*
FROM PREDICT(MODEL = @model, DATA = [wwi].[SampleData] AS d,RUNTIME = ONNX) WITH (prediction real) AS p;

-- Store a batch of predictions
INSERT INTO PredictionResults
SELECT d.*, p.Score
FROM PREDICT(MODEL = @model, DATA = [wwi].[SampleData] AS d,RUNTIME = ONNX) WITH (prediction real) AS p;

